function Tournament({ tournament }) {
    return (
        <tr>
        <th colSpan="2">
            {tournament.name}
        </th>
        </tr>
    );
}

export default function TournamentTable({ tournaments }) {
const rows = [];

tournaments.forEach((tournament) => {
    rows.push(
    <Tournament
        name={tournament.name} />
    );
});

return (
    <table>
    <thead>
        <tr>
        <th>Turniere</th>
        </tr>
    </thead>
    <tbody>{rows}</tbody>
    </table>
);
}
